// import logo from "./logo.svg";
import "./App.css";
import NewsTop from "./components/NewsTop";
import Register from "./components/Register";
import { BrowserRouter, Route, Switch } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Switch>
          <Route path="/register">
            <Register />
          </Route>
          <Route path="/">
            <NewsTop />
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
